import React from 'react';


const ExerciseContainer = () => {
    if (this.state.loading) 
        return <Loading />        
    
    return(
        <div>
            <Title
                userName="Alex"
            />
            <ExerciseList
                exercises= {this.state.data}
            />

            <AddButton/>
        </div>
    )
}

export default ExerciseContainer;
